import React from 'react';
import ReactDOM from 'react-dom';


function Greeting(){
    return(
        <h2>Hi,</h2>
    )
}

ReactDOM.render(
    <>
<h1>
    Hello
</h1>
<Greeting />
    </>

    ,
    document.getElementById('root')
)
